function PassingDataOnEvent() {
    const add = (a, b) => {
      alert(`${a} + ${b} = ${a + b}`);
    };
    return (
      <div>
        <h2>Passing Data on Event</h2>
        <button onClick={() => add(2, 3)}
                className="btn btn-primary">
          Pass 2 and 3 to add()
        </button>
      </div>
    );
  }
  export default PassingDataOnEvent;
